(1, 'Inspektor Nadzoru - Sanitarny', '', 'Kontrakt 1 - Rozbudowa i modernizacja oczyszczalni ścieków w Brzegu- Dostawa urządzeń do zagęszczania osadów.\nKontrakt 2 - Rozbudowa i modernizacja oczyszczalni ścieków w Brzegu- Budowa wiaty- magazynu na terenie oczyszczalni .\nKontrakt 4- Budowa nowej sieci kanalizacyjnej w Kościerzycach. \nKontrakt 5 - Budowa sieci wodociągowej w ul. Małujowickiej.\nKontrakt 7 - Modernizacja sieci kanalizacji sanitarnej na terenie miasta Brzeg- zaprojektowanie i wykonanie renowacji sieci kanalizacyjnej o przekroju kołowym DN200-DN600 i kanałąów jajowych 600x900 o łącznej długości 5,99 km z wykorzystaniem technologii CIPP.\nKontrakt 8 - Modernizacja kanału nadodrzańskiego w Brzegu- zaprojektowanie i wykonanie renowacji siec i kanalizacyjnej o przekroju kołowym DN800-DN1500 o łącznej długości 1,58 km metodą reliningu rurami GRP.\nKontrakt 10 -  Przebudowa sieci wodociągowej w ulicy Saperskiej w Brzegu.\nKontrakt 11 - Budowa sieci wodociągowej i kanalizacji sanitarnej w ul. Strzeleckiej w Brzegu.\nKontrakt 12 - Zwiększenie funkcjonalności systemu monitorowania urządzeń kanalizacyjnych w aglomeracji Brzeg.\nKontrakt 13 -  Zautomatyzowanie procesów technologicznych SUW Gierszowice.', 0, 13092173, '2014-08-01', '2015-11-30', 'Przedsiębiorstwo Wodociągów i Kanalizacji w Brzegu Sp. z o. o.', 126, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnudGMi11hiHDN9x0ypBAVxm2xPfRqMmSm8NtcmEfbdCUK0HLe0zJW0kzgQ', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Inspektor+Nadzoru+-+Sanitarny&entry.798100984&entry.29292353=Kontrakt+1+-+Rozbudowa+i+modernizacja+oczyszczalni+%C5%9Bciek%C3%B3w+w+Brzegu-+Dostawa+urz%C4%85dze%C5%84+do+zag%C4%99szczania+osad%C3%B3w.%0AKontrakt+2+-+Rozbudowa+i+modernizacja+oczyszczalni+%C5%9Bciek%C3%B3w+w+Brzegu-+Budowa+wiaty-+magazynu+na+terenie+oczyszczalni+.%0AKontrakt+4-+Budowa+nowej+