(118, 'Architekt', '', 'Przebudowa i rozbudowa istniejącego budynku i mieszczącego w sobie zaplecze sanitarno- szatniowe przy stadionie w Ścinawie, teren działek nr 466/1.\nBilans powierzchni:\n-wielkość powierzchni zabudowy budynku przed rozbudową - 240,2 m2\n-wielkość powierzchni zabudowy budynku po rozbudowie - 256,6 m2,\n-wielkość powierzchni użytkowej budynku przed rozbudową - 318,90 m2,\n-wielkość powierzchni użytkowej budynku po rozbudowie 310,90 m2,\n-maksymalna wysokość do kalenicy dla dachu nie przekracza 11,31 m,\n-powierzchnia terenów utwardzonych wynosi 418,1 m2,\n-powierzchnia zabudowy dla terenu działki 446/2 nie przekracza 20%,\n-powierzchnia biologicznie czynna działki 446/2 nie jest mniejsza niż 40% i wynosi 48%powierzchni działki wraz z nawierzchnią boiska,\n-powierzchnia działki 446/2 - 26272 m2,\n- charakterystyka: brak kondygnacji podziemnych, 3 kondygnacje naziemne.\nZakres: Projekt Budowlany, Projekt Wykonawczy, Specyfikacje, Kosztorysy, Nadzór Autorski.', 0, 0, '2016-01-01', '2016-12-31', 'Gmina Ścinawa', 60, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnufLrpJY6_FHTyxOn2XFEwTQw2eGBCtEBOXifA3E72qKyx-nlfkAf3qY6A', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Architekt&entry.798100984&entry.29292353=Przebudowa+i+rozbudowa+istniej%C4%85cego+budynku+i+mieszcz%C4%85cego+w+sobie+zaplecze+sanitarno-+szatniowe+przy+stadionie+w+%C5%9Acinawie,+teren+dzia%C5%82ek+nr+466/1.%0ABilans+powierzchni:%0A-wielko%C5%9B%C4%87+powierzchni+zabudowy+budynku+przed+rozbudow%C4%85+-+240,2+m2%0A-wielko%C5%9B%C4%87+powierzchni+zabudowy+budynku+po+rozbudowie+-+256,6+m2,%0A-wielko%C5%9B%C4%87+powierzchni+u%C5%BCytkowej+budynku+przed+rozbudow%C4%85+-+318,90+m2,%0A-wielko%C5%9B%C4%87+powierzchni+u%C5%BCytkowej+budynku+po+rozbudowie+310,90+m2,%0A-maksymalna+wysoko%C5%9B%C4%87+do+kalenicy+dla+dachu+nie+przekracza+11,31+m,%0A-p