(153, 'Inspektor Nadzoru - Elektryk', '', 'Projekty budowlane rozbudowy oświetlenia ulicznego wsi Lubiatów, Jasienica Górna, Piotrowice Nyskie, Jodłów, Jarnołtów, Meszno, Kałków, Nadziejów oraz wykonanie projektów budowlanych oświetlenia parkowego w miejscowości Piotrowice Nyskie oraz Parku Solarium wraz z monitoringiem w Otmuchowie w/g procedury ustawy o zamówieniach publicznych. \nProjekty zostały zrealizowane w zabytkowym  zespole dworsko- pałacowym w Piotrkowicach Nyskich wpisanym do rejestru zabytków województwa opolskiego pod numerem 156 i zabytkowym parku w Otmuchowie wpisanym  do rejestru zabytków województwa opolskiego pod numerem 107/84.\nW ramach projektu zrealizowano nadzór inwestorski dla prac przy oświetleniu ulicznym oraz doradztwo techniczne.', 0, 0, '2007-01-01', '2012-01-04', 'Burmistrz Otmuchowa Jan Woźniak', 117, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnudcQ_QxQO9jMdkdsPFDgvAE3Lxe-4gyTQUKh1XDg_uekz5UEjG87a7sgQ', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Inspektor+Nadzoru+-+Elektryk&entry.798100984&entry.29292353=Projekty+budowlane+rozbudowy+o%C5%9Bwietlenia+ulicznego+wsi+Lubiat%C3%B3w,+Jasienica+G%C3%B3rna,+Piotrowice+Nyskie,+Jod%C5%82%C3%B3w,+Jarno%C5%82t%C3%B3w,+Meszno,+Ka%C5%82k%C3%B3w,+Nadziej%C3%B3w+oraz+wykonanie+projekt%C3%B3w+budowlanych+o%C5%9Bwietlenia+parkowego+w+miejscowo%C5%9Bci+Piotrowice+Nyskie+oraz+Parku+Solarium+wraz+z+monitoringiem+w+Otmuchowie+w/g+procedury+ustawy+o+zam%C3%B3wieniach+publicznych.+%0AProjekty+zosta%C5%82y+zrealizowane+w+zabytkowym++zespole+dworsko-+pa%C5%82acowym+w+Piotrkowicach+Nyskich+wpisanym+do+rejestru+zabytk%C3%B3w+wojew%C3%B3dztwa+opolskiego+pod+numerem+156+i+zabytkowym+parku+w+Otmuchowie+wpisanym++do+rejestru+zabytk%C3%B3w+wojew%C3%B3dztwa+opolskiego+pod+numerem+107/84.%0AW+ramach+projektu+zrealizowano+nadz%C3%B3r+inwestorski+dla+prac+przy+o%C5%9B