(154, 'Kierownik Robót/budowy - Elektryk', '', 'Pomiary skuteczności ochrony przeciwpożarowej, rezystancji izolacji instalacji elektrycznej oraz pomiary rezystancji instalacji odgromowej.\nPrzegląd i konserwacja stacji typu MSTt 20/630 zasilającej nasz zakład.', 0, 0, '1998-01-01', '2001-12-31', 'JAEGER-POLSKA Sp. z o.o.', 117, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnufAGQhfhqLzgOchPYkbnr_iFSVgRbtcMimjvB3yZSRCAKfsMZtSW0AkdA', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Rob%C3%B3t/budowy+-+Elektryk&entry.798100984&entry.29292353=Pomiary+skuteczno%C5%9Bci+ochrony+przeciwpo%C5%BCarowej,+rezystancji+izolacji+instalacji+elektrycznej+oraz+pomiary+rezystancji+instalacji+odgromowej.%0APrzegl%C4%85d+i+konserwacja+stacji+typu+MSTt+20/630+zasilaj%C4%85cej+nasz+zak%C5%82ad.&entry.1908770888&entry.1657899946&entry.1321521525=1998-01-01&entry.1364057121=2001-12-31&entry.1091899488=JAEGER-POLSKA+Sp.+z+o.o.'),
(155, 'Kierownik Robót/budowy - Elektryk', '', 'Pomiary skuteczności ochrony przeciwpożarowej, rezystancji izolacji instalacji elektrycznej oraz pomiary rezystancji instalacji odgromowej budynków i budowli zlecanych nam do realizacji.\nDodatkowo wykonywała kompleksowy nadzór nad pracami elektrycznymi budynków i budowli:\n-Budynki mieszkalne w Wilkowie gmina Niemcza,\n-Budynek mieszkalny 60 rodzinny w Ząbkowicach Śląskich,\n-Budynek mieszkalny 27 rodzinny w Sieroszowie gmina Ząbkowice Śląskie,\n-Budynek mieszkalno- biurowy w Ziębicach ul. Wojska Polskiego 15,\n-Magazyn Zboża w Tomicach gmina Ząbkowice Śląskie.', 0, 0, '1997-01-01', '2003-03-02', 'BUDOPOL Ziębice', 117, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnucbVNS1JMJC6Xs6jkzYI_uSJxb9T0WFXcLD1SzD6XMVjYRm3Vtt_g', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Rob%C3%B3t/budowy+-+Elektryk&entry.798100984&entry.29292353=Pomiary+skuteczno%C5%9Bci+ochrony+przeciwpo%C5%BCarowej,+rezystancji+izolacji+instalacji+elektrycznej+oraz+pomiary+rezystancji+instalacji+odgromowej+budynk%C3%B3w+i+budowli+zlecanych+nam+do+realizacji.%0ADodatkowo+wykonywa%C5%82a+kompleksowy+nadz%C3%B3r+nad+pracami+elektrycznymi+budynk%C3%B3w+i+budowli:%0A-Budynki+mieszkalne+w+Wilkowie+gmina+Niemcza,%0A-Budynek+mieszkalny+60+rodzinny+w+Z%C4%85bkowicach+%C5%9Al%C4%85skich,%0A-Budynek+mieszkalny+27+rodzinny+w+Sieroszowie+gmina+Z%C4%85bkowice+%C5%9Al%C4%85skie,%0A-Budynek+mieszkalno-+biurowy+w+Zi%C4%99bicach+ul.+Wojska+Polskiego+15,%0A-Magazyn+Zbo%C5%BCa+w+Tomicach+gmina+Z%C4%85bkowice+%C5%9Al%C4%85skie.&entry.1908770888&entry.1657899946&entry.1321521525=1997-01-01&entry.1364057121=2003-03-02&entry.1091899488=BUDOPOL+Zi%C4%99bice'),
(156, 'Kierownik Robót/budowy - Elektryk', '', '1.Projekt linii kablowej 20 kV zasilającej Młyn Kukurydzy w Ziębicach.\n2.Projekt stacji transformatorowej 2x 800 kVA dla zasilania obiektu j/w.\n3.Projekt oraz wykonawstwo kompensacji mocy biernej obiektu z baterią kondensatorów o mocy 240 kVar.\n4.Nadzór inwestorski nad całością prac elektrycznych obiektu Młyn Kukurydzy w Ziębicach.', 0, 0, '2004-01-01', '2006-04-06', 'BIO CORN', 117, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnudFye7vaJMrGadu7_V0zkc700f-BZXYv8J6me1TGwPYZmbTApolpgoG', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Rob%C3%B3t/budowy+-+Elektryk&entry.798100984&entry.29292353=1.Projekt+linii+kablowej+20+kV+zasilaj%C4%85cej+M%C5%82yn+Kukurydzy+w+Zi%C4%99bicach.%0A2.Projekt+stacji+transformatorowej+2x+800+kVA+dla+zasilania+obiektu+j/w.%0A3.Projekt+oraz+wykonawstwo+kompensacji+mocy+biernej+obiektu+z+bateri%C4%85+kondensator%C3%B3w+o+mocy+240+kVar.%0A4.Nadz%C3%B3r+inwestorski+nad+ca%C5%82o%C5%9Bci%C4%85+prac+elektrycznych+obiektu+M%C5%82yn+Kukurydzy+w+Zi%C4%99bicach.&entry.1908770888&entry.1657899946&entry.1321521525=2004-01-01&entry.1364057121=2006-04-06&entry.1091899488=BIO+CORN'),
