(184, 'Rozliczeniowiec - Roboty', 'Rozliczanie kontaktów robót budowlanych wg warunków FIDIC', '-\"Uszczelnienie sieci kanalizacyjnej\"- etap I i II - rozliczenie ryczałtowe,\n-\"Rozbudowa sieci wodno- kanalizacyjnej ul. Matejki\" - rozliczenie obmiarowe,\n-\"Rozbudowa instalacji do produkcji energii elektrycznej\" - rozliczenie ryczałtowe, w ramach FS pn. \"Budowa kanalizacji w Gminie Strzelin wraz z modernizacją oczyszczalni ścieków w Chociwelu\"\n-\" Modernizacja systemu napowietrzania na oczyszczalni ścieków w Chociwielu\"- rozliczenie obmiarowe,\n-\"Renowacja kanalizacji sanitarnej w Strzelinie\" - rozliczenie ryczałtowe,', 0, 0, '2008-01-01', '2018-03-31', 'Praca dla ENVI KONSULTING', 131, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnucTOtH1qNOLdHEb0h7jOGCXvGOnWr84WW40TWUnDhThQhPm7DeQ3787_g', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Rozliczeniowiec+-+Roboty&entry.798100984=Rozliczanie+kontakt%C3%B3w+rob%C3%B3t+budowlanych+wg+warunk%C3%B3w+FIDIC&entry.29292353=-%22Uszczelnienie+sieci+kanalizacyjnej%22-+etap+I+i+II+-+rozliczenie+rycza%C5%82towe,%0A-%22Rozbudowa+sieci+wodno-+kanalizacyjnej+ul.+Matejki%22+-+rozliczenie+obmiarowe,%0A-%22Rozbudowa+instalacji+do+produkcji+energii+elektrycznej%22+-+rozliczenie+rycza%C5%82towe,+w+ramach+FS+pn.+%22Budowa+kanalizacji+w+Gminie+Strzelin+wraz+z+modernizacj%C4%85+oczyszczalni+%C5%9Bciek%C3%B3w+w+Chociwelu%22%0A-%22+Modernizacja+systemu+napowietrzania+na+oczyszczalni+%C5%9Bciek%C3%B3w+w+Chociwielu%22-+rozliczenie+obmiarowe,%0A-%22Renowacja+kanalizacji+sanitarnej+w+Strzelinie%22+-+rozliczenie+rycza%C5%82towe,&entry.1908770888&entry.1657899946&entry.1321521525=2008-01-01&entry.1364057121=2018-03-31&entry.1091899488=Praca+dla+ENVI+KONSULTING'),
