(199, 'Inspektor Nadzoru - Sanitarny', '', ' Rozwiązanie gospodarki wodno-ściekowej w Gminy Nowogrodziec – Etap Ia – w ramach projektu zrealizowano trzy zadania:  Zadanie nr I „Budowa kanalizacji sanitarnej w Gierałtowie – Etap I;\nZadanie nr II „Budowa kanalizacji sanitarnej w Gościszowie – Etap II”;\nZadanie III „Budowa kanalizacji sanitarnej i sieci wodociągowej w Nowogrodźcu”                                                                         \n\nNabyta praktyka i kwalifikacje: Nadzór nad realizacją zakończonych kontraktów, dla których uzyskano pozwolenie na użytkowanie. W ramach wymienionych zadań wykonano:\n4km sieci wodociągowej i 20km kanalizacji sanitarnej ', 0, 18343670, '2014-10-01', '2015-09-30', 'SAFEGE', 134, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnufk1awI7_29Z5S-YZuvu9XY6Rmd8ubJVH1cToUjpV6vMQT23j2OoDbOuw', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Inspektor+Nadzoru+-+Sanitarny&entry.798100984&entry.29292353=+Rozwi%C4%85zanie+gospodarki+wodno-%C5%9Bciekowej+w+Gminy+Nowogrodziec+%E2%80%93+Etap+Ia+%E2%80%93+w+ramach+projektu+zrealizowano+trzy+zadania:++Zadanie+nr+I+%E2%80%9EBudowa+kanalizacji+sanitarnej+w+Giera%C5%82towie+%E2%80%93+Etap+I;%0AZadanie+nr+II+%E2%80%9EBudowa+kanalizacji+sanitarnej+w+Go%C5%9Bciszowie+%E2%80%93+Etap+II%E2%80%9D;%0AZadanie+III+%E2%80%9EBudowa+kanalizacji+sanitarnej+i+sieci+wodoci%C4%85gowej+w+Nowogrod%C5%BAcu%E2%80%9D+++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++%0A%0ANabyta+praktyka+i+kwalifikacje:+Nadz%C3%B3r+nad+realizacj%C4%85+zako%C5%84czonych+kontrakt%C3%B3w,+dla+kt%C3%B3rych+uzyskano+pozwolenie+na+u%C5%BCytkowanie.+W+ramach+wymienionych+zada%C5%84+wykonano:%0A4km+sieci+wodoci%C4%85gowej+i+20km+kanalizacji+sanitarnej+&entry.1908770888&entry.1657899946=18343670&entry.1321521525=2014-10-01&entry.1364057121=2015-09-30&entry.1091899488=SAFEGE'),
(200, 'Inspektor Nadzoru - Sanitarny', '', 'Rozwiązanie gospodarki wodno-ściekowej w Gminy Nowogrodziec – Etap Ia – w ramach projektu zrealizowano zadanie: „Budowa sieci wodociągowej i kanalizacyjnej w miejscowościach Nowogrodziec, Milików, Parzyce, Zebrzydowa i Gościszów wraz z przyłączami”\nNabyta praktyka i kwalifikacje: Nadzór nad realizacją zakończonych kontraktów, dla których uzyskano pozwolenie na użytkowanie. W ramach kontraktu wykonano: 0,995km sieci wodociągowej i 34,976km kanalizacji sanitarnej ', 0, 24453223, '2013-09-01', '2014-10-31', 'SAFEGE', 134, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnudcBinhqe8sajjsRXDUFuVWchdco7aQAquuy7waeFULTS579JslqbeTng', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Inspektor+Nadzoru+-+Sanitarny&entry.798100984&entry.29292353=Rozwi%C4%85zanie+gospodarki+wodno-%C5%9Bciekowej+w+Gminy+Nowogrodziec+%E2%80%93+Etap+Ia+%E2%80%93+w+ramach+projektu+zrealizowano+zadanie:+%E2%80%9EBudowa+sieci+wodoci%C4%85gowej+i+kanalizacyjnej+w+miejscowo%C5%9Bciach+Nowogrodziec,+Milik%C3%B3w,+Parzyce,+Zebrzydowa+i+Go%C5%9Bcisz%C3%B3w+wraz+z+przy%C5%82%C4%85czami%E2%80%9D%0ANabyta+praktyka+i+kwalifikacje:+Nadz%C3%B3r+nad+realizacj%C4%85+zako%C5%84czonych+kontrakt%C3%B3w,+dla+kt%C3%B3rych+uzyskano+pozwolenie+na+u%C5%BCytkowanie.+W+ramach+kontraktu+wykonano:+0,995km+sieci+wodoci%C4%85gowej+i+34,976km+kanalizacji+sanitarnej+&entry.1908770888&entry.1657899946=24453223&entry.1321521525=2013-09-01&entry.1364057121=2014-10-31&entry.1091899488=SAFEGE'),
(201, 'Inspektor Nadzoru - Sanitarny', '', ' Rozwiązanie gospodarki wodno-ściekowej w Gminy Nowogrodziec – Etap Ia – w ramach projektu zrealizowano dwa kontrakty:  Kontrakt nr I „Przebudowa i budowa oczyszczalni ścieków w Nowogrodźcu”\nKontrakt nr II „Budowa i  rozbudowa sieci wodociągowej oraz kanalizacji  sanitarnej w Nowogrodźcu”                                                                         \n\nNabyta praktyka i kwalifikacje: Nadzór nad realizacją zakończonych kontraktów, dla których uzyskano pozwolenie na użytkowanie. W ramach Kontraktu nr II  \n– pełnienie funkcji inspektora nadzoru robót sanitarnych w tym  - budowa kanalizacji sanitarnej wraz z przyłączami o łącznej długości 15,1 km,  w tym 12,5 km sieci grawitacyjnej  i  ok. 2,6 km sieci ciśnieniowej  wraz z infrastrukturą towarzyszącą – pompownie ścieków 6 szt., oraz 6 szt przepompowni domowych. Budowa sieci wodociągowej wraz z przyłączami o   łącznej długości ok.13,4 km ', 0, 910241621, '2010-09-01', '2012-11-30', 'SAFEGE', 134, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnufbPs45MqkAQBW76Co_yyOBGpjv3629yiXLSm9IzPQHS8L0XXCiqc3zrA', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Inspektor+Nadzoru+-+Sanitarny&entry.798100984&entry.29292353=+Rozwi%C4%85zanie+gospodarki+wodno-%C5%9Bciekowej+w+Gminy+Nowogrodziec+%E2%80%93+Etap+Ia+%E2%80%93+w+ramach+projektu+zrealizowano+dwa+kontrakty:++Kontrakt+nr+I+%E2%80%9EPrzebudowa+i+budowa+oczyszczalni+%C5%9Bciek%C3%B3w+w+Nowogrod%C5%BAcu%E2%80%9D%0AKontrakt+nr+II+%E2%80%9EBudowa+i++rozbudowa+sieci+wodoci%C4%85gowej+oraz+kanalizacji++sanitarnej+w+Nowogrod%C5%BAcu%E2%80%9D+++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++%0A%0ANabyta+praktyka+i+kwalifikacje:+Nadz%C3%B3r+nad+realizacj%C4%85+zako%C5%84czonych+kontrakt%C3%B3w,+dla+kt%C3%B3rych+uzyskano+pozwolenie+na+u%C5%BCytkowanie.+W+ramach+Kontraktu+nr+II++%0A%E2%80%93+pe%C5%82nienie+funkcji+inspektora+nadzoru+rob%C3%B3t+sanitarnych+w+tym++-+budowa+kanalizacji+sanitarnej+wraz+z+przy%C5%82%C4%85czami+o+%C5%82%C4%85cznej+d%C5%82ugo%C5%9Bci+15,1+km,++w+tym+12,5+km+sieci+grawitacyjnej++i++ok.+2,6+km+sieci+ci%C5%9Bnieniowej++wraz+z+infrastruktur%C4%85+towarzysz%C4%85c%C4%85+%E2%80%93+pompownie+%C5%9Bciek%C3%B3w+6+szt.,+oraz+6+szt+przepompowni+domowych.+Budowa+sieci+wodoci%C4%85gowej+wraz+z+przy%C5%82%C4%85czami+o+++%C5%82%C4%85cznej+d%C5%82ugo%C5%9Bci+ok.13,4+km+&entry.1908770888&entry.1657899946=910241621&entry.1321521525=2010-09-01&entry.1364057121=2012-11-30&entry.1091899488=SAFEGE'),
(202, 'Inspektor Nadzoru - Sanitarny', '', 'Sprawowanie funkcji Inspektora Nadzoru robót sanitarnych na projekcie pn.  „Uporządkowanie gospodarki wodno – ściekowej gmin zlewni  rzeki Czerwona Woda” – w ramach projektu zrealizowano dwa zadania:  \n1. Budowa oczyszczalni ścieków w Sulikowie o przepustowości Qśrd=950m3/dobę\n2. Budowy i rozbudowy sieci wodociągowej o długości 16,7km w Sulikowie oraz kanalizacji sanitarnej o długości około 40km na obszarze Gminy Sulików, Platerówka i Zgorzelec.\nKontrakt realizowany zgodnie z warunkami FIDIC\n', 0, 31008846, '2010-02-01', '2012-11-30', 'Brak informacji', 134, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnueAjy51ppnJ7Pb_4AyACFko_i3CEus2CxMmWZz8gnUDNt8boqnmyWiIsw', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Inspektor+Nadzoru+-+Sanitarny&entry.798100984&entry.29292353=Sprawowanie+funkcji+Inspektora+Nadzoru+rob%C3%B3t+sanitarnych+na+projekcie+pn.++%E2%80%9EUporz%C4%85dkowanie+gospodarki+wodno+%E2%80%93+%C5%9Bciekowej+gmin+zlewni++rzeki+Czerwona+Woda%E2%80%9D+%E2%80%93+w+ramach+projektu+zrealizowano+dwa+zadania:++%0A1.+Budowa+oczyszczalni+%C5%9Bciek%C3%B3w+w+Sulikowie+o+przepustowo%C5%9Bci+Q%C5%9Brd%3D950m3/dob%C4%99%0A2.+Budowy+i+rozbudowy+sieci+wodoci%C4%85gowej+o+d%C5%82ugo%C5%9Bci+16,7km+w+Sulikowie+oraz+kanalizacji+sanitarnej+o+d%C5%82ugo%C5%9Bci+oko%C5%82o+40km+na+obszarze+Gminy+Sulik%C3%B3w,+Plater%C3%B3wka+i+Zgorzelec.%0AKontrakt+realizowany+zgodnie+z+warunkami+FIDIC%0A&entry.1908770888&entry.1657899946=31008846&entry.1321521525=2010-02-01&entry.1364057121=2012-11-30&entry.1091899488=Brak+informacji'),
(203, 'Inspektor Nadzoru - Sanitarny', '', 'Rozwój systemu wodociągów – budowa wodociągu w Milikowie, Gościszowie oraz w Kierżnie w powiązaniem Czernej”\nNabyta praktyka i kwalifikacje: budowa sieci wodociągowej o łącznej długości 30km; budowa przyłączy wodociągowych o łącznej długości 12.440 mb; modernizacja SUW w Nowogrodźcu,  modernizacja SUW w Parzycach, budowa dwóch zbiorników wody czystej w Parzycach, wykonanie dwóch ujęć wody, wykonanie pompowni strefowej', 0, 5985313, '2006-01-31', '2008-09-27', ' Instytut Zarządzania i Samorządności Sp. z o.o. ', 134, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnufrDkXwmhy0oX17FY_uW_WPuBDj47fZXvg-Ko2cIFDabeKN0f7gf0qEMQ', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Inspektor+Nadzoru+-+Sanitarny&entry.798100984&entry.29292353=Rozw%C3%B3j+systemu+wodoci%C4%85g%C3%B3w+%E2%80%93+budowa+wodoci%C4%85gu+w+Milikowie,+Go%C5%9Bciszowie+oraz+w+Kier%C5%BCnie+w+powi%C4%85zaniem+Czernej%E2%80%9D%0ANabyta+praktyka+i+kwalifikacje:+budowa+sieci+wodoci%C4%85gowej+o+%C5%82%C4%85cznej+d%C5%82ugo%C5%9Bci+30km;+budowa+przy%C5%82%C4%85czy+wodoci%C4%85gowych+o+%C5%82%C4%85cznej+d%C5%82ugo%C5%9Bci+12.440+mb;+modernizacja+SUW+w+Nowogrod%C5%BAcu,++modernizacja+SUW+w+Parzycach,+budowa+dw%C3%B3ch+zbiornik%C3%B3w+wody+czystej+w+Parzycach,+wykonanie+dw%C3%B3ch+uj%C4%99%C4%87+wody,+wykonanie+pompowni+strefowej&entry.1908770888&entry.1657899946=5985313&entry.1321521525=2006-01-31&entry.1364057121=2008-09-27&entry.1091899488=+Instytut+Zarz%C4%85dzania+i+Samorz%C4%85dno%C5%9Bci+Sp.+z+o.o.+'),
(204, 'Inspektor Nadzoru - Sanitarny', '', 'Ochrona wód rzeki Nysy Łużyckiej – Budowa zintegrowanego systemu gospodarki wodno – ściekowej z modernizacją oczyszczalni ścieków dla Gminy Zawidów , Sulików i Habratnice (Republika Czeska)\nNabyta praktyka i kwalifikacje: nadzór : 20,185km kanalizacji sanitarnej i deszczowej, 6,275km sieci wodociągowej.\n', 0, 21036600, '2004-07-01', '2006-11-20', 'Urząd Miejski w Zawidowie', 134, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnuf2UIKDfTP_LIg52iHr9TIAbm01OLMdSEcyGGIw7_TfcxM4iMgwzBLUug', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Inspektor+Nadzoru+-+Sanitarny&entry.798100984&entry.29292353=Ochrona+w%C3%B3d+rzeki+Nysy+%C5%81u%C5%BCyckiej+%E2%80%93+Budowa+zintegrowanego+systemu+gospodarki+wodno+%E2%80%93+%C5%9Bciekowej+z+modernizacj%C4%85+oczyszczalni+%C5%9Bciek%C3%B3w+dla+Gminy+Zawid%C3%B3w+,+Sulik%C3%B3w+i+Habratnice+(Republika+Czeska)%0ANabyta+praktyka+i+kwalifikacje:+nadz%C3%B3r+:+20,185km+kanalizacji+sanitarnej+i+deszczowej,+6,275km+sieci+wodoci%C4%85gowej.%0A&entry.1908770888&entry.1657899946=21036600&entry.1321521525=2004-07-01&entry.1364057121=2006-11-20&entry.1091899488=Urz%C4%85d+Miejski+w+Zawidowie');
