(222, 'Inspektor Nadzoru - Konstruktor', '', ' Inspektor nadzoru inwestorskiego w branży konstrukcyjno – budowlanej i drogowej z ramienia Inżyniera Kontraktu – firmy ECM Warszawa, przy realizacji zadania inwestycyjnego w ramach Funduszu Spójności pn.: \"Karkonoski System Wodociągów i kanalizacji – Etap I\" na rzecz Karkonoskiego Systemu Wodociągów i Kanalizacji Sp. z o.o. w Mysłakowicach pow. Jelenia Góra. Poniżej zestawienie nadzorowane kontraktów:\n-Budowa sieci wodociągowej wraz z ujęciem wody i stacją wodociągową oraz budową i modernizacją sieci kanalizacji sanitarnej, deszczowej i ogólnospławnej \nw gm. Kowary (K-VI),\n-Budowa sieci wodociągowej i kanalizacji sanitarnej wraz z przepompowniami ścieków w gm. Mysłakowice (K-VII),\n-Budowa i modernizacja sieci wodociągowych i kanalizacyjnych w gm. Szklarska Poręba (K-IX),\n-Budowa oczyszczalni ścieków dla m. Szklarska Poręba przy ul. Hofmana o wydajności Qdśr=2000m3/d oraz tłoczni ścieków przy ul. B. Prusa w Szklarska Porębie (K-X),		', 0, 0, '2009-07-01', '2010-12-31', 'ECM Warszawa', 133, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnuchcyQ5Efuc-PCsDMU5rXtNWspcIv6DdVdafAUZ6BCj1JgsJj5pk7Y8YQ', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Inspektor+Nadzoru+-+Konstruktor&entry.798100984&entry.29292353=+Inspektor+nadzoru+inwestorskiego+w+bran%C5%BCy+konstrukcyjno+%E2%80%93+budowlanej+i+drogowej+z+ramienia+In%C5%BCyniera+Kontraktu+%E2%80%93+firmy+ECM+Warszawa,+przy+realizacji+zadania+inwestycyjnego+w+ramach+Funduszu+Sp%C3%B3jno%C5%9Bci+pn.:+%22Karkonoski+System+Wodoci%C4%85g%C3%B3w+i+kanalizacji+%E2%80%93+Etap+I%22+na+rzecz+Karkonoskiego+Systemu+Wodoci%C4%85g%C3%B3w+i+Kanalizacji+Sp.+z+o.o.+w+Mys%C5%82akowicach+pow.+Jelenia+G%C3%B3ra.+Poni%C5%BCej+zestawienie+nadzorowane+kontrakt%C3%B3w:%0A-Budowa+sieci+wodoci%C4%85gowej+wraz+z+uj%C4%99ciem+wody+i+stacj%C4%85+wodoci%C4