(223, 'Kierownik Robót/budowy - Sanitarny', '', '− Opracowanie Projektu Budowlanego (we współpracy z Zakładem Badawczo – Wdrożeniowym Politechniki Wrocławskiej w Jelenia Góra) Przepompowni Ścieków (zbiornik podziemny gł. 8 m + budynek z 4 pompami o wale pionowym) w Przysusze (k. Radomia) wraz z nadzorem autorskim i inwestorskim,\n-  Opracowanie Projektu Budowlanego cz. konstrukcyjna oczyszczalni ścieków typu BOS-200 w Karpaczu (we współpracy z firmą TESAN - Jelenia Góra) wraz z nadzorem autorskim.\n- Opracowanie Projektu Budowlanego cz. konstrukcyjna oczyszczalni ścieków typu BOS-150 w Podgórzynie (we współpracy z firmą TESAN - Jelenia Góra) wraz z nadzorem autorskim.\n- Opracowanie Projektu Budowlanego (we współpracy z firmą TESAN - Jelenia Góra) cz. konstrukcyjna oczyszczalni ścieków mechaniczno – biologicznej typu KOS−3 w Jeleniej Górze-Cieplicach wraz z nadzorem autorskim i inwestorskim,\n- Opracowanie Projektu Budowlanego (we współpracy z firmą TESAN - Jelenia Góra) cz. konstrukcyjna ujęcia wody na \"Białym Potoku\" w Wojcieszycach wraz z nadzorem autorskim i inwestorskim,\n−	Opracowanie Projektu Budowlanego (we współpracy z firmą TESAN - Jelenia Góra) oczyszczalni ścieków typu \"Bioblok\" 200 MUm w Pielgrzymce wraz z nadzorem autorskim.', 0, 0, '1989-01-01', '1997-12-31', 'Własna działalność gospodarcza', 133, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnuecQU41q4P6CrzqOu9BA61XNaMwTX-qjZJkNWvhxS501UGNk0XoZ0hutQ', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Rob%C3%B3t/budowy+-+Sanitarny&entry.798100984&entry.29292353=%E2%88%92+Opracowanie+Projektu+Budowlanego+(we+wsp%C3%B3%C5%82pracy+z+Zak%C5%82adem+Badawczo+%E2%80%93+Wdro%C5%BCeniowym+Politechniki+Wroc%C5%82awskiej+w+Jelenia+G%C3%B3ra)+Przepompowni+%C5%9Aciek%C3%B3w+(zbiornik+podziemny+g%C5%82.+8+m+%2B+budynek+z+4+pompami+o+wale+pionowym)+w+Przysusze+(k.+Radomia)+wraz+z+nadzorem+autorskim+i+inwestorskim,%0A-++Opracowanie+Projektu+Budowlanego+cz.+konstrukcyjna+oczyszczalni+%C5%9Bciek%C3%B3w+typu+BOS-200+w+Karpaczu+(we+wsp%C3%B3%C5%82pracy+z+firm%C4%85+TESAN+-+Jelenia+G%C3%B3ra)+wraz+z+nadzorem+autorskim.%0A-+Opracowanie+Projektu+Budowlanego+cz.+konstrukcyjna+oczyszczalni+%C5%9Bciek%C3%B3w+typu+BOS-150+w+Podg%C3%B3rzynie+(we+wsp%C3%B3%C5%82pracy+z+firm%C4%85+TESAN+-+Jelenia+G%C3%B3ra)+wraz+z+nadzorem+autorskim.%0A-+Opracowanie+Projektu+Budowlanego+(we+wsp%C3%B3%C5%82pracy+z+firm%C4%85+TESAN+-+Jelenia+G%C3%B3ra)+cz.+konstrukcyjna+oczyszczalni+%C5%9Bciek%C3%B3w+mechaniczno+%E2%80%93+biologicznej+typu+KOS%E2%88%923+w+Jeleniej+G%C3%B3rze-Cieplicach+wraz+z+nadzorem+autorskim+i+inwestorskim,%0A-+Opracowanie+Projektu+Budowlanego+(we+wsp%C3%B3%C5%82pracy+z+firm%C4%85+TESAN+-+Jelenia+G%C3%B3ra)+cz.+konstrukcyjna+uj%C4%99cia+wody+na+%22Bia%C5%82ym+Potoku%22+w+Wojcieszycach+wraz+z+nadzorem+autorskim+i+inwestorskim,%0A%E2%88%92%09Opracowanie+Projektu+Budowlanego+(we+wsp%C3%B3%C5%82pracy+z+firm%C4%85+TESAN+-+Jelenia+G%C3%B3ra)+oczyszczalni+%C5%9Bciek%C3%B3w+typu+%22Bioblok%22+200+MUm+w+Pielgrzymce+wraz+z+nadzorem+autorskim.&entry.1908770888&entry.1657899946&entry.1321521525=1989-01-01&entry.1364057121=1997-12-31&entry.1091899488=W%C5%82asna+dzia%C5%82alno%C5%9B%C4%87+gospodarcza'),
(224, 'Inspektor Nadzoru - Konstruktor', '', 'Opracowywanie Projektów Budowlanych i Budowlano – Wykonawczych różnych obiektów w konstrukcji żelbetowej, stalowej, drewnianej. Opracowanie wielu Orzeczeń i Ekspertyz Budowlanych w różnej tematyce związanej z tzw. budownictwem kubaturowym. Przygotowywanie i opracowywanie dokumentów do przetargów publicznych (SIWZ), kosztorysów inwestorskich i przedmiarów robót dla Oferentów. Sprawdzanie projektów budowlanych, opiniowanie zgodności kosztorysów budowlanych z obowiązującymi rozporządzeniami. Nadzorowanie robót budowlanych i opracowywanie harmonogramów rzeczowo-finansowych oraz zatrudnienia dla inwestycji liniowych i kubaturowych. \n', 0, 0, '1989-09-01', '2018-03-21', 'BIKON - Biuro Inżynierskie Budownictwa ', 133, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnucIKHAXGexl7cbZHO39Ps7aMYldwXwCtaw4C6wnGUZxd9Ff-WQn9RDubw', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Inspektor+Nadzoru+-+Konstruktor&entry.798100984&entry.29292353=Opracowywanie+Projekt%C3%B3w+Budowlanych+i+Budowlano+%E2%80%93+Wykonawczych+r%C3%B3%C5%BCnych+obiekt%C3%B3w+w+konstrukcji+%C5%BCelbetowej,+stalowej,+drewnianej.+Opracowanie+wielu+Orzecze%C5%84+i+Ekspertyz+Budowlanych+w+r%C3%B3%C5%BCnej+tematyce+zwi%C4%85zanej+z+tzw.+budownictwem+kubaturowym.+Przygotowywanie+i+opracowywanie+dokument%C3%B3w+do+przetarg%C3%B3w+publicznych+(SIWZ),+kosztorys%C3%B3w+inwestorskich+i+przedmiar%C3%B3w+rob%C3%B3t+dla+Oferent%C3%B3w.+Sprawdzanie+projekt%C3%B3w+budowlanych,+opiniowanie+zgodno%C5%9Bci+kosztorys%C3%B3w+budowlanych+z+obowi%C4%85zuj%C4%85cymi+rozporz%C4%85dzeniami.+Nadzorowanie+rob%C3%B3t+budowlanych+i+opracowywanie+harmonogram%C3%B3w+rzeczowo-finansowych+oraz+zatrudnienia+dla+inwestycji+liniowych+i+kubaturowych.+%0A&entry.1908770888&entry.1657899946&entry.1321521525=1989-09-01&entry.1364057121=2018-03-21&entry.1091899488=BIKON+-+Biuro+In%C5%BCynierskie+Budownictwa+'),
(225, 'Kierownik Projektu - Inżynier Rezydent', '', ' Pełnienie funkcji Inżyniera Kontraktu przy realizacji zakończonej inwestycji budowlanej z zakresu gospodarki wodno-ściekowej pn.„Modernizacja oczyszczalni ścieków w mieście Bolesławiec” -realizowanej w oparciu o warunki kontraktowe FIDIC. \nZarządzanie Projektem jako Inżynier Kontraktu dla Inwestycji która    obejmowała:\n-Budowę i rozbudowę sieci kanalizacji sanitarnej, wodociągowej i technologicznej o długości 2,5 km;\n-Budowę 1 kpl przepompowni ścieków (wód nadosadowych) wraz z    monitoringiem;\n-System sterowania AKPiA.	\n-Modernizację i rozbudowę części biologicznej oczyszczalni,\n-Modernizację i rozbudowę części osadowej oczyszczalni z wykorzystaniem biogazu.\n', 17800000, 0, '2004-12-01', '2009-08-30', 'SAFEGE', 132, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnucTKV2IrC9IOddlTWbyXhMLGOWWzkmpZWvxVz7R0XVhXHELVcRb9DS55A', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Projektu+-+In%C5%BCynier+Rezydent&entry.798100984&entry.29292353=+Pe%C5%82nienie+funkcji+In%C5%BCyniera+Kontraktu+przy+realizacji+zako%C5%84czonej+inwestycji+budowlanej+z+zakresu+gospodarki+wodno-%C5%9Bciekowej+pn.%E2%80%9EModernizacja+oczyszczalni+%C5%9Bciek%C3%B3w+w+mie%C5%9Bcie+Boles%C5%82awiec%E2%80%9D+-realizowanej+w+oparciu+o+warunki+kontraktowe+FIDIC.+%0AZarz%C4%85dzanie+Projektem+jako+In%C5%BCynier+Kontraktu+dla+Inwestycji+kt%C3%B3ra++++obejmowa%C5%82a:%0A-Budow%C4%99+i+rozbudow%C4%99+sieci+kanalizacji+sanitarnej,+wodoci%C4%85gowej+i+technologicznej+o+d%C5%82ugo%C5%9Bci+2,5+km;%0A-Budow%C4%99+1+kpl+przepompowni+%C5%9Bciek%C3%B3w+(w%C3%B3d+nadosadowych)+wraz+z++++monitoringiem;%0A-System+sterowania+AKPiA.%09%0A-Modernizacj%C4%99+i+rozbudow%C4%99+cz%C4%99%C5%9Bci+biologicznej+oczyszczalni,%0A-Modernizacj%C4%99+i+rozbudow%C4%99+cz%C4%99%C5%9Bci+osadowej+oczyszczalni+z+wykorzystani