(226, 'Kierownik Projektu - Inżynier Rezydent', '', 'Pełnienie funkcji Inżyniera Kontraktu przy realizacji zakończonej inwestycji budowlanej z zakresu gospodarki wodno-ściekowej pn; „Kanalizacja w mieście Bolesławiec” -realizowanej w oparciu o warunki kontraktowe FIDIC\nZarządzanie Projektem jako Inżynier Kontraktu dla Inwestycji która       obejmowała:\n-Rozbudowa i przebudowa sieci kanalizacji sanitarnej o długości 28,9 km w warunkach miejskich;\n-Budowa i przebudowa przepompowni ścieków – 5 kpl.\nwraz z monitoringiem.\n\n', 32000000, 0, '2005-05-01', '2007-07-31', 'SAFEGE', 132, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnufcQgIDfrUthVamgBSb6wyFAI2bqZFbn98mtSIT_mlU3alHGcps-L0CNQ', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Projektu+-+In%C5%BCynier+Rezydent&entry.798100984&entry.29292353=Pe%C5%82nienie+funkcji+In%C5%BCyniera+Kontraktu+przy+realizacji+zako%C5%84czonej+inwestycji+budowlanej+z+zakresu+gospodarki+wodno-%C5%9Bciekowej+pn;+%E2%80%9EKanalizacja+w+mie%C5%9Bcie+Boles%C5%82awiec%E2%80%9D+-realizowanej+w+oparciu+o+warunki+kontraktowe+FIDIC%0AZarz%C4%85dzanie+Projektem+jako+In%C5%BCynier+Kontraktu+dla+Inwestycji+kt%C3%B3ra+++++++obejmowa%C5%82a:%0A-Rozbudowa+i+przebudowa+sieci+kanalizacji+sanitarnej+o+d%C5%82ugo%C5%9Bci+28,9+km+w+warunkach+miejskich;%0A-Budowa+i+przebudowa+przepompowni+%C5%9Bciek%C3%B3w+%E2%80%93+5+kpl.%0Awraz+z+monitoringiem.%0A%0A&entry.1908770888=32000000&entry.1657899946&entry.1321521525=2005-05-01&entry.1364057121=2007-07-31&entry.1091899488=SAFEGE'),
(227, 'Kierownik Projektu - Inżynier Rezydent', '', 'Pełnienie funkcji Inżyniera Kontraktu przy realizacji zakończonej inwestycji budowlanej z zakresu gospodarki wodno-ściekowej pn. „Zapewnienie prawidłowej gospodarki wodno – ściekowej w gminie Strzegom” realizowanej w oparciu o warunki kontraktowe FIDIC\nZarządzanie Projektem jako Inżynier Kontraktu dla Inwestycji która obejmowała:\n - Budowę i przebudowę kanalizacji sanitarnej we wsiach: Jaroszów, Goczałków, Rogoźnica, Wieśnica, Żółkiewka, Żelazów i Kostrza o długości ponad 43  km,\n - Budowę 8 kpl przepompowni sieciowych wraz z monitoringiem, ', 17700000, 0, '2009-12-01', '2013-06-30', 'SAFEGE', 132, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnuemRuYngnb6Z062Qxo3nDys0KzVZMoj9AonHSaDlILvLCtXVopIArjI', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Projektu+-+In%C5%BCynier+Rezydent&entry.798100984&entry.29292353=Pe%C5%82nienie+funkcji+In%C5%BCyniera+Kontraktu+przy+realizacji+zako%C5%84czonej+inwestycji+budowlanej+z+zakresu+gospodarki+wodno-%C5%9Bciekowej+pn.+%E2%80%9EZapewnienie+prawid%C5%82owej+gospodarki+wodno+%E2%80%93+%C5%9Bciekowej+w+gminie+Strzegom%E2%80%9D+realizowanej+w+oparciu+o+warunki+kontraktowe+FIDIC%0AZarz%C4%85dzanie+Projektem+jako+In%C5%BCynier+Kontraktu+dla+Inwestycji+kt%C3%B3ra+obejmowa%C5%82a:%0A+-+Budow%C4%99+i+przebudow%C4%99+kanalizacji+sanitarnej+we+wsiach:+Jarosz%C3%B3w,+Gocza%C5%82k%C3%B3w,+Rogo%C5%BAnica,+Wie%C5%9Bnica,+%C5%BB%C3%B3%C5%82kiewka,+%C5%BBelaz%C3%B3w+i+Kostrza+o+d%C5%82ugo%C5%9Bci+ponad+43++km,%0A+-+Budow%C4%99+8+kpl+przepompowni+sieciowych+wraz+z+monitoringiem,+&entry.1908770888=17700000&entry.1657899946&entry.1321521525=2009-12-01&entry.1364057121=2013-06-30&entry.1091899488=SAFEGE'),
(228, 'Kierownik Projektu - Inżynier Rezydent', '', 'Pełnienie funkcji Inżyniera Kontraktu przy realizacji zakończonej inwestycji budowlanej z zakresu gospodarki wodno-ściekowej pn.„Rozbudowa oczyszczalni ścieków w Strzegomiu przy ul. Rybnej”- realizowanej w oparciu o warunki kontraktowe FIDIC. \n  Zarządzanie Projektem jako Inżynier Kontraktu dla Inwestycji która           \n obejmowała:\n-Budowę i rozbudowę sieci kanalizacji sanitarnej i wodociągowej o długości 0,5 km;\n-Budowę 2 kpl. przepompowni ścieków wraz z    monitoringiem;\n-System sterowania AKPiA.\n-usprawnienie ciągu mechanicznego oczyszczania ścieków,\n-Budowę urządzeń do beztlenowej mezofilowej stabilizacji osadu wraz z systemem ujmowania, uzdatniania i wykorzystania biogazu.\n', 15793000, 0, '2010-05-01', '2012-09-30', 'SAFEGE', 132, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnufUgjqb8gdjt4AlF1YUDOOkcNFPmMZ0DU8pLABg6vB7LRGCg3qlGVuZ', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Projektu+-+In%C5%BCynier+Rezydent&entry.798100984&entry.29292353=Pe%C5%82nienie+funkcji+In%C5%BCyniera+Kontraktu+przy+realizacji+zako%C5%84czonej+inwestycji+budowlanej+z+zakresu+gospodarki+wodno-%C5%9Bciekowej+pn.%E2%80%9ERozbudowa+oczyszczalni+%C5%9Bciek%C3%B3w+w+Strzegomiu+przy+ul.+Rybnej%E2%80%9D-+realizowanej+w+oparciu+o+warunki+kontraktowe+FIDIC.+%0A++Zarz%C4%85dzanie+Projektem+jako+In%C5%BCynier+Kontraktu+dla+Inwestycji+kt%C3%B3ra+++++++++++%0A+obejmowa%C5%82a:%0A-Budow%C4%99+i+rozbudow%C4%99+sieci+kanalizacji+sanitarnej+i+wodoci%C4%85gowej+o+d%C5%82ugo%C5%9Bci+0,5+km;%0A-Budow%C4%99+2+kpl.+przepompowni+%C5%9Bciek%C3%B3w+wraz+z++++monitoringiem;%0A-System+sterowania+AKPiA.%0A-usprawnienie+ci%C4%85gu+mechanicznego+oczyszczania+%C5%9Bciek%C3%B3w,%0A-Budow%C4%99+urz%C4%85dze%C5%84+do+beztlenowej+mezofilowej+stabilizacji+osadu+wraz+z+systemem+ujmowania,+uzdatniania+i+wykorzystania+biogazu.%0A&entry.1908770888=15793000&entry.1657899946&entry.1321521525=2010-05-01&entry.1364057121=2012-09-30&entry.1091899488=SAFEGE'),
(229, 'Kierownik Projektu - Inżynier Rezydent', '', 'Pełnienie funkcji Inżyniera Kontraktu przy realizacji zakończonej inwestycji budowlanej z zakresu gospodarki wodno-ściekowej pn. „Uporządkowanie gospodarki wodno – ściekowej gmin leżących w zlewni rzeki Czerwona Woda” realizowanej w oparciu o warunki kontraktowe FIDIC.\nZarządzanie Projektem jako Inżynier Kontraktu dla Inwestycji która obejmowała:\n- Budowę i przebudowę kanalizacji sanitarnej o długości ponad 39 km;\n- Odtworzenie nawierzchni drogowych asfaltowych o łącznej powierzchni co najmniej 10 tys. m2;\n - Budowę 31 kpl przepompowni sieciowych wraz z monitoringiem, w tym jedna o wydajności   minimum Q=40 m3/h;\n- Budowę i przebudowę sieci wodociągowej o długości 16 km.\n', 34008846, 0, '2010-02-01', '2012-11-30', 'SAFEGE', 132, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnud7uHbj5O-lthF1cHPNsMBtCCtY4o_xenkGUH5yW6dOdUYzyZjjv3We8Q', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Projektu+-+In%C5%BCynier+Rezydent&entry.798100984&entry.29292353=Pe%C5%82nienie+funkcji+In%C5%BCyniera+Kontraktu+przy+realizacji+zako%C5%84czonej+inwestycji+budowlanej+z+zakresu+gospodarki+wodno-%C5%9Bciekowej+pn.+%E2%80%9EUporz%C4%85dkowanie+gospodarki+wodno+%E2%80%93+%C5%9Bciekowej+gmin+le%C5%BC%C4%85cych+w+zlewni+rzeki+Czerwona+Woda%E2%80%9D+realizowanej+w+oparciu+o+warunki+kontraktowe+FIDIC.%0AZarz%C4%85dzanie+Projektem+jako+In%C5%BCynier+Kontraktu+dla+Inwestycji+kt%C3%B3ra+obejmowa%C5%82a:%0A-+Budow%C4%99+i+przebudow%C4%99+kanalizacji+sanitarnej+o+d%C5%82ugo%C5%9Bci+ponad+39+km;%0A-+Odtworzenie+nawierzchni+drogowych+asfaltowych+o+%C5%82%C4%85cznej+powierzchni+co+najmniej+10+tys.+m2;%0A+-+Budow%C4%99+31+kpl+przepompowni+sieciowych+wraz+z+monitoringiem,+w+tym+jedna+o+wydajno%C5%9Bci+++minimum+Q%3D40+m3/h;%0A-+Budow%C4%99+i+przebudow%C4%99+sieci+wodoci%C4%85gowej+o+d%C5%82ug