(230, 'Kierownik Projektu - Inżynier Rezydent', '', 'Pełnienie funkcji Inżyniera Kontraktu przy realizacji zakończonej inwestycji budowlanej z zakresu gospodarki wodno-ściekowej pn. „Budowa sieci kanalizacji sanitarnej i wodociągowej wraz z obiektami towarzyszącymi dla miejscowości Stara Kamienica, Kromnów, Kopaniec” ” realizowanej w oparciu o warunki kontraktowe FIDIC.\n  Zarządzanie Projektem jako Inżynier Kontraktu dla Inwestycji która obejmowała:\n- Budowę kanalizacji sanitarnej o długości – ok. 22,0 km;\n - Budowę sieci wodociągowej o długości – ok. 24,0 km\n - Budowę przepompowni ścieków sanitarnych wraz z monitoringiem – 1 kpl.\n - Budowę oczyszczalni ścieków – 1 kpl.\n - Budowę SUW – 3 kpl.\n', 25119017, 0, '2010-07-01', '2011-12-31', 'SAFEGE', 132, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnuclSPpYVO4m1bhUxkVTKeDALIJ87GdCgp6pFFgqA1xMAcnrMx9G6qzGAw', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Projektu+-+In%C5%BCynier+Rezydent&entry.798100984&entry.29292353=Pe%C5%82nienie+funkcji+In%C5%BCyniera+Kontraktu+przy+realizacji+zako%C5%84czonej+inwestycji+budowlanej+z+zakresu+gospodarki+wodno-%C5%9Bciekowej+pn.+%E2%80%9EBudowa+sieci+kanalizacji+sanitarnej+i+wodoci%C4%85gowej+wraz+z+obiektami+towarzysz%C4%85cymi+dla+miejscowo%C5%9Bci+Stara+Kamienica,+Kromn%C3%B3w,+Kopaniec%E2%80%9D+%E2%80%9D+realizowanej+w+oparciu+o+warunki+kontraktowe+FIDIC.%0A++Zarz%C4%85dzanie+Projektem+jako+In%C5%BCynier+Kontraktu+dla+Inwestycji+kt%C3%B3ra+obejmowa%C5%82a:%0A-+Budow%C4%99+kanalizacji+sanitarnej+o+d%C5%82ugo%C5%9Bci+%E2%80%93+ok.+22,0+km;%0A+-+Budow%C4%99+sieci+wodoci%C4%85gowej+o+d%C5%82ugo%C5%9Bci+%E2%80%93+ok.+24,0+km%0A+-+Budow%C4%99+przepompowni+%C5%9Bciek%C3%B3w+sanitarnych+wraz+z+monitoringiem+%E2%80%93+1+kpl.%0A+-+Budow%C4%99+oczyszczalni+%C5%9Bciek%C3%B3w+%E2%80%93+1+kpl.%0A+-+Budow%C4%99+SUW+%E2%80%93+3+kpl.