(231, 'Kierownik Projektu - Inżynier Rezydent', '', 'Pełnienie funkcji Inżyniera Kontraktu przy realizacji zakończonej inwestycji budowlanej z zakresu gospodarki wodno-ściekowej pn. „Budowa kanalizacji sanitarnej w miejscowościach Brzezina, Wilkszyn oraz kanalizacji tłocznej relacji Lutynia-Brzezina  w ramach   przedsięwzięcia „Zapewnienie prawidłowej gospodarki wodno – ściekowej aglomeracji Wrocław, w części gmina Miękinia” realizowanej w oparciu o warunki kontraktowe FIDIC.\nZarządzanie Projektem jako Inżynier Kontraktu. dla Inwestycji która obejmowała budowę kanalizacji sanitarnej w miejscowościach : Miękinia, Mrozów, Lutynia, Wróblowice, Brzezina i Wilkszyn, w tym::\n- Budowę kanalizacji sanitarnej o długości ponad 17km;\n-  Budowę 3 kpl przepompowni sieciowych wraz z monitoringiem\n', 14662097, 0, '2013-05-01', '2016-04-30', 'SAFEGE', 132, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnuekFZ7hIHYsl4WIjFIBoeRVLBSUwdH3EqUYEFYuwRTe_c9v5LFkYxjHSw', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Projektu+-+In%C5%BCynier+Rezydent&entry.798100984&entry.29292353=Pe%C5%82nienie+funkcji+In%C5%BCyniera+Kontraktu+przy+realizacji+zako%C5%84czonej+inwestycji+budowlanej+z+zakresu+gospodarki+wodno-%C5%9Bciekowej+pn.+%E2%80%9EBudowa+kanalizacji+sanitarnej+w+miejscowo%C5%9Bciach+Brzezina,+Wilkszyn+oraz+kanalizacji+t%C5%82ocznej+relacji+Lutynia-Brzezina++w+ramach+++przedsi%C4%99wzi%C4%99cia+%E2%80%9EZapewnienie+prawid%C5%82owej+gospodarki+wodno+%E2%80%93+%C5%9Bciekowej+aglomeracji+Wroc%C5%82aw,+w+cz%C4%99%C5%9Bci+gmina+Mi%C4%99kinia%E2%80%9D+realizowanej+w+oparciu+o+warunki+kontraktowe+FIDIC.%0AZarz%C4%85dzanie+Projektem+jako+In%C5%BCynier+Kontraktu.+dla+Inwestycji+kt%C3%B3ra+obejmowa%C5%82a+budow%C4%99+kanalizacji+sanitarnej+w+miejscowo%C5%9Bciach+:+Mi%C4%99kinia,+Mroz%C3%B3w,+Lutynia,+Wr%C3%B3blowice,+Brzezina+i+Wilkszyn,