(232, 'Kierownik Projektu - Inżynier Rezydent', '', 'Pełnienie funkcji Inżyniera Kontraktu przy realizacji zakończonej inwestycji budowlanej z zakresu gospodarki wodno-ściekowej pn. „Zapewnienie prawidłowej gospodarki wodno – ściekowej aglomeracji Wrocław, w części gmina Miękinia” realizowanej w oparciu o warunki kontraktowe FIDIC.\nZarządzanie Projektem jako Inżynier Kontraktu. dla Inwestycji która obejmowała budowę kanalizacji sanitarnej w miejscowościach : Brzezina, Wilkszyn oraz  kanalizacji tłocznej relacji  Lutynia-Brzezina, w tym:\n-Budowa kanalizacji sanitarnej - ok. 18 km\n-Budowa przepompowni ścieków – 3kpl. (wraz z monitoringiem)\n-Budowa tłoczni ścieków – 4 kpl. (wraz z monitoringiem)\n\n', 10314178, 0, '2014-09-01', '2015-10-31', 'SAFEGE', 132, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnudIvr6wqDj-xiZJlVjhkX0uEC611SJNiiO7LyyM0WZLcM-iSCZAJfwZfA', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Projektu+-+In%C5%BCynier+Rezydent&entry.798100984&entry.29292353=Pe%C5%82nienie+funkcji+In%C5%BCyniera+Kontraktu+przy+realizacji+zako%C5%84czonej+inwestycji+budowlanej+z+zakresu+gospodarki+wodno-%C5%9Bciekowej+pn.+%E2%80%9EZapewnienie+prawid%C5%82owej+gospodarki+wodno+%E2%80%93+%C5%9Bciekowej+aglomeracji+Wroc%C5%82aw,+w+cz%C4%99%C5%9Bci+gmina+Mi%C4%99kinia%E2%80%9D+realizowanej+w+oparciu+o+warunki+kontraktowe+FIDIC.%0AZarz%C4%85dzanie+Projektem+jako+In%C5%BCynier+Kontraktu.+dla+Inwestycji+kt%C3%B3ra+obejmowa%C5%82a+budow%C4%99+kanalizacji+sanitarnej+w+miejscowo%C5%9Bciach+:+Brzezina,+Wilkszyn+oraz++kanalizacji+t%C5%82ocznej+relacji++Lutynia-Brzezina,+w+tym:%0A-Budowa+kanalizacji+sanitarnej+-+ok.+18+km%0A-Budowa+przepompowni+%C5%9Bciek%C3%B3w+%E2%80%93+3kpl.+(wraz+z+monitoringiem)%0A-Budowa+t%C5%82oczni+%C5%9Bciek%C3%B3w+%E2%80%93+4+kpl.+(wraz+z+monitoringiem)%0A%0A&entry.1908770888=10314178&entry.165789994