(233, 'Kierownik Projektu - Inżynier Rezydent', '', 'Pełnienie funkcji Inżyniera Kontraktu przy realizacji zakończonej inwestycji budowlanej z zakresu gospodarki wodno-ściekowej pn. „Rozwiązanie gospodarki wodno – ściekowej w Gminie Nowogrodziec – Etap Ia” realizowanej w oparciu o warunki kontraktowe FIDIC.W ramach Projektu sprawowano nadzór nad dwoma kontraktami:\nKontrakt I – Przebudowa i budowa oczyszczalni ścieków w Nowogrodźcu \nKontrakt II – Przebudowa i rozbudowa sieci wodociągowych i kanalizacyjnych w Nowogrodźcu\n Zarządzanie Projektem jako Inżynier Kontraktu dla Inwestycji która           \n obejmowała:\nKontrakt I\n- Budowę kanalizacji sanitarnej – 203,2m\n- Budowę  sieci wodociągowej – 184,0 m\n- Przebudowę pompowni głównej ścieków  i pompowni ścieków oczyszczonych wraz z   monitoringiem.\n-  Budowę i przebudowę 16 obiektów oczyszczalni ścieków,\n- System sterowania AKPiA.\nKontrakt II\n- Budowę i rozbudowę kanalizacji sanitarnej o długości 15km;\n- Budowę 6 kpl sieciowych przepompowni ścieków wraz z  \n  monitoringiem;\n- Budowę i rozbudowę sieci wodociągowej o długości 17km\n- Przyłącza kanalizacyjne o długości ponad 3km;\n- Przyłącza wodociągowe o długości ponad 3km.\n', 26788967, 0, '2010-02-01', '2013-05-31', 'SAFEGE', 132, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnucBaZaNh1ZAs2aeU1xGNZmfXMUViFv9Lkh55hEzU2W_ZnGErU_ShhNcDQ', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Projektu+-+In%C5%BCynier+Rezydent&entry.798100984&entry.29292353=Pe%C5%82nienie+funkcji+In%C5%BCyniera+Kontraktu+przy+realizacji+zako%C5%84czonej+inwestycji+budowlanej+z+zakresu+gospodarki+wodno-%C5%9Bciekowej+pn.+%E2%80%9ERozwi%C4%85zanie+gospodarki+wodno+%E2%80%93+%C5%9Bciekowej+w+Gminie+Nowogrodziec+%E2%80%93+Etap+Ia%E2%80%9D+realizowanej+w+oparciu+o+warunki+kontraktowe+FIDIC.W+ramach+Projektu+sprawowano+nadz%C3%B3r+nad+dwoma+kontraktami:%0AKontrakt+I+%E2%80%93+Przebudowa+i+budowa+oczyszczalni+%C5%9Bciek%C3%B3w+w+Nowogrod%C5%BAcu+%0AKontrakt+II+%E2%80%93+Przebudowa+i+rozbudowa+sieci+wodoci%C4%85gowych+i+kanalizacyjnych+w+Nowogrod%C5%BAcu%0A+Zarz%C4%85dzanie+Projektem+jako+In%C5%BCynier+Kontraktu+dla+Inwestycji+kt%C3%B3ra+++++++++++%0A+obejmowa%C5%82a:%0AKontrakt+I%0A-+Budow%C4%99+kanalizacji+sanitarnej+%E2%80%93+203,2m%0A-+Budow%C4%99++sieci+wodoci%C4%85gowej+%E2%80%93+184,0+m%0A-+Przebudow%C4%99+pompowni+g%C5%82%C3%B3wnej+%C5%9Bciek%C3%B3w++i+pompowni+%C5%9Bciek%C3%B3w+oczyszczonych+wraz+z+++monitoringiem.%0A-++Budow%C4%99+i+przebudow%C4%99+16+obiekt%C3%B3w+oczyszczalni+%C5%9Bciek%C3%B3w,%0A-+System+sterowania+AKPiA.%0AKontrakt+II%0A-+Budow%C4%99+i+rozbudow%C4%99+kanalizacji+sanitarnej+o+d%C5%82ugo%C5%9Bci+15km;%0A-+Budow%C4%99+6+kpl+sieciowych+przepompowni+%C5%9Bciek%C3%B3w+wraz+z++%0A++monitoringiem;%0A-+Budow%C4%99+i+rozbudow%C4%99+sieci+wodoci%C4%85gowej+o+d%C5%82ugo%C5%9Bci+17km%0A-+Przy%C5%82%C4%85cza+kanalizacyjne+o+d%C5%82ugo%C5%9Bci+ponad+3km;%0A-+Przy%C5%82%C4%85cza+wodoci%C4%85gowe+o+d%C5%82ugo%C5%9Bci+ponad+3km.%0A&entry.1908770888=26788967&entry.1657899946&entry.1321521525=2010-02-01&entry.1364057121=2013-05-31&entry.1091899488=SAFEGE'),
(234, 'Kierownik Projektu - Inżynier Rezydent', '', ' Pełnienie funkcji Inżyniera Kontraktu przy realizacji zakończonej inwestycji budowlanej z zakresu gospodarki wodno-ściekowej pn. „Rozwiązanie gospodarki wodno – ściekowej w Gminie Nowogrodziec – Etap Ia” realizowanej w oparciu o warunki kontraktowe FIDIC.\n Zarządzanie Projektem jako Inżynier Kontraktu dla Inwestycji która obejmowała budowę kanalizacji sanitarnej w 6 miejscowościach w ramach 8 zadań o łącznej długości ok. 12km oraz 14 przepompowni ścieków i 680 przyłączy ', 26282584, 0, '2013-02-01', '2015-05-31', 'SAFEGE', 132, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnuekfkgCtCuYJawLYxIbTtHbY1r0NhFbohrdKijWcEpTmWYB4MHeJcmpEw', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Projektu+-+In%C5%BCynier+Rezydent&entry.798100984&entry.29292353=+Pe%C5%82nienie+funkcji+In%C5%BCyniera+Kontraktu+przy+realizacji+zako%C5%84czonej+inwestycji+budowlanej+z+zakresu+gospodarki+wodno-%C5%9Bciekowej+pn.+%E2%80%9ERozwi%C4%85zanie+gospodarki+wodno+%E2%80%93+%C5%9Bciekowej+w+Gminie+Nowogrodziec+%E2%80%93+Etap+Ia%E2%80%9D+realizowanej+w+oparciu+o+warunki+kontraktowe+FIDIC.%0A+Zarz%C4%85dzanie+Projektem+jako+In%C5%BCynier+Kontraktu+dla+Inwestycji+kt%C3%B3ra+obejmowa%C5%82a+budow%C4%99+kanalizacji+sanitarnej+w+6+miejscowo%C5%9Bciach+w+ramach+8+zada%C5%84+o+%C5%82%C4%85cznej+d%C5%82ugo%C5%9Bci+ok.+12km+oraz+14+przepompowni+%C5%9Bciek%C3%B3w+i+680+przy%C5%82%C4%85czy+&entry.1908770888=26282584&entry.1657899946&entry.1321521525=2013-02-01&entry.1364057121=2015-05-31&entry.1091899488=SAFEGE'),
(235, 'Kierownik Projektu - Inżynier Rezydent', '', 'Pełnienie funkcji Inżyniera Kontraktu przy realizacji zakończonej inwestycji budowlanej z zakresu gospodarki wodno-ściekowej pn. „Uporządkowanie gospodarki wodno – ściekowej południowo – wschodniej części miasta Głogów” realizowanej w oparciu o warunki kontraktowe FIDIC.\nZarządzanie Projektem jako Inżynier Kontraktu dla Inwestycji która obejmowała budowę 13,5km kanalizacji sanitarnej wraz z przepompowniami ścieków i monitoringiem, 10km kanalizacji deszczowej i 144szt wpustów ulicznych\n', 44907878, 0, '2012-08-01', '2015-06-30', 'SAFEGE', 132, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnudn6BCpvIBdLqPrgUQkUOcZ2hSQAgKszGGN5xoxJqMgHZZmtR6HDjGMGQ', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Projektu+-+In%C5%BCynier+Rezydent&entry.798100984&entry.29292353=Pe%C5%82nienie+funkcji+In%C5%BCyniera+Kontraktu+przy+realizacji+zako%C5%84czonej+inwestycji+budowlanej+z+zakresu+gospodarki+wodno-%C5%9Bciekowej+pn.+%E2%80%9EUporz%C4%85dkowanie+gospodarki+wodno+%E2%80%93+%C5%9Bciekowej+po%C5%82udniowo+%E2%80%93+wschodniej+cz%C4%99%C5%9Bci+miasta+G%C5%82og%C3%B3w%E2%80%9D+realizowanej+w+oparciu+o+warunki+kontraktowe+FIDIC.%0AZarz%C4%85dzanie+Projektem+jako+In%C5%BCynier+Kontraktu+dla+Inwestycji+kt%C3%B3ra+obejmowa%C5%82a+budow%C4%99+13,5km+kanalizacji+sanitarnej+wraz+z+przepompowniami+%C5%9Bciek%C3%B3w+i+monitoringiem,+10km+kanalizacji+deszczowej+i+144szt+wpust%C3%B3w+ulicznych%0A&entry.1908770888=44907878&entry.1657899946&entry.1321521525=2012-08-01&entry.1364057121=2015-06-30&entry.1091899488=SAFEGE');
