(236, 'Kierownik Projektu - Inżynier Rezydent', '', 'Pełnienie funkcji Inżyniera Kontraktu przy realizacji zakończonej inwestycji budowlanej z zakresu gospodarki wodno-ściekowej pn. „Uporządkowanie gospodarki ściekowej w aglomeracji Krosno Odrzańskie – etap I” realizowanej w oparciu o warunki kontraktowe FIDIC.\n Zarządzanie Projektem jako Inżynier Kontraktu dla Inwestycji która obejmowała budowę 23km kanalizacji sanitarnej wraz z 24 przepompowniami sieciowymi ścieków i monitoringiem.\n', 15088654, 0, '2012-08-01', '2016-03-31', 'SAFEGE', 132, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnueUgBCbmSpIK-cRnbGBszTizdi7AXLDdbdz5AVHrnPkLStH2VPe8Fdfeg', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Kierownik+Projektu+-+In%C5%BCynier+Rezydent&entry.798100984&entry.29292353=Pe%C5%82nienie+funkcji+In%C5%BCyniera+Kontraktu+przy+realizacji+zako%C5%84czonej+inwestycji+budowlanej+z+zakresu+gospodarki+wodno-%C5%9Bciekowej+pn.+%E2%80%9EUporz%C4%85dkowanie+gospodarki+%C5%9Bciekowej+w+aglomeracji+Krosno+Odrza%C5%84skie+%E2%80%93+etap+I%E2%80%9D+realizowanej+w+oparciu+o+warunki+kontraktowe+FIDIC.%0A+Zarz%C4%85dzanie+Projektem+jako+In%C5%BCynier+Kontraktu+dla+Inwestycji+kt%C3%B3ra+obejmowa%C5%82a+budow%C4%99+23km+kanalizacji+sanitarnej+wraz+z+24+przepompowniami+sieciowymi+%C5%9Bciek%C3%B3w+i+monitoringiem.%0A&entry.1908770888=15088654&entry.1657899946&entry.1321521525=2012-08-01&entry.1364057121=2016-03-31&entry.1091899488=SAFEGE'),
(237, 'Ekspert Pzp', 'Oczyszczanie ścieków w aglomeracji Grodków', 'Postępowania o udzielenie zamówienia publicznego- projekt POIiŚ:\n1.Przetarg nieograniczony - Budowa sieci kanalizacji sanitarnej \nw miejscowościach: Nowa Wieś Mała, Lubcz, Jeszkotle - Szacunkowa wartość zadania – 18,2 mln zł.,\n2.Przetarg nieograniczony - Budowa sieci kanalizacji sanitarnej \nw miejscowościach: Gola Grodkowska, Lipowa, Przylesie Dolne, Wierzbnik - Szacunkowa wartość zadania – 27,3 mln zł.,\n3.Przetarg nieograniczony - Budowa sieci kanalizacji sanitarnej \nw miejscowościach: Wojsław, Polana, Kolnica, Młodoszowice, Bąków - Szacunkowa wartość zadania – 27,8 mln zł.,\n4.Przetarg nieograniczony - Budowa sieci kanalizacji sanitarnej \nw miejscowościach: Wójtowice, Jędrzejów, Strzegów, Starowice Dolne - Szacunkowa wartość zadania – 28,6 mln zł.,,\n5.Przetarg nieograniczony na wybór Inżyniera Kontraktu - Szacunkowa wartość zamówienia – 1,5 mln zł.\n', 0, 77800000, '2010-01-01', '2015-12-09', 'GRODWIK Sp. z o.o.', 29, 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?edit2=2_ABaOnufQ-33Lv7fMvz0tTNgJOdOFYC0zent49hRBBNXhGKbt4Y68S8bxxOBkPg', 'https://docs.google.com/forms/d/e/1FAIpQLSeeysOE7Ry8mXMPuthH7mghtMhuIU7rt6O0wxQPkaShEsDRUA/viewform?usp=pp_url&entry.1995376000=Ekspert+Pzp&entry.798100984=Oczyszczanie+%C5%9Bciek%C3%B3w+w+aglomeracji+Grodk%C3%B3w&entry.29292353=Post%C4%99powania+o+udzielenie+zam%C3%B3wienia+publicznego-+projekt+POIi%C5%9A:%0A1.Przetarg+nieograniczony+-+Budowa+sieci+kanalizacji+sanitarnej+%0Aw+miejscowo%C5%9Bciach:+Nowa+Wie%C5%9B+Ma%C5%82a,+Lubcz,+Jeszkotle+-+Szacunkowa+warto%C5%9B%C4%87+zadania+%E2%80%93+18,2+mln+z%C5%82.,%0A2.Przetarg+nieograniczony+-+Budowa+sieci+kanalizacji+sanitarnej+%0Aw+miejscowo%C5%9Bciach:+Gola+Grodkowska,+Lipowa,+Przylesie+Dolne,+Wierzbnik+-+Szacunkowa+warto%C5%9B%C4%87+zadania+%E2%80%93+27,3+mln+z%C5%82.,%0A3.Przetarg+nieograniczony+-+Budowa+sieci+kanalizacji+sanitarnej+%0Aw+miejscowo%C5%9Bcia